import ItemFilter from './ItemFilter';

export default class SearchPanel extends Component {
    render() {      
        return (
            <div>
                <input className="form-control" type="search" placeholder='Type here to search'/>
                <ItemFilter/>
            </div>
            
        )
    }
}
